		parse_metadata: function(ref) {
			var offset = 0;

			var read_int32 = function() {
				var value = this.Module.getValue(ref + offset, "i32");
				offset += 4;
				return value;
			}

			var read_string = function() {
				var value = this.Module.Pointer_stringify(this.Module.getValue(ref + offset, "i8*"));
				offset += 4;
				return value;
			}

			var res = {};

			res.length = read_int32();
			res.intro_length = read_int32();
			res.loop_length = read_int32();
			res.play_length = read_int32();

			offset += 4*12; // skip unused bytes

			res.system = read_string();
			res.game = read_string();
			res.song = read_string();
			res.author = read_string();
			res.copyright = read_string();
			res.comment = read_string();

			return res;
		},

		updateSongInfo: function(filename, result) {
		
			var subtune_count = this.Module.ccall("gme_track_count", "number", ["number"], [this.emu]);

			this.Module.ccall("gme_ignore_silence", "number", ["number"], [this.emu, 1]);
			var voice_count = this.Module.ccall("gme_voice_count", "number", ["number"], [this.emu]);

			
			if (this.Module.ccall("gme_track_info", "number", ["number", "number", "number"], [this.emu, this.ref, this.currentTrack]) != 0)
			console.error("could not load metadata");

			var metadata = this.parse_metadata(this.Module.getValue(this.ref, "*"));

			result.channels= voice_count;
			result.subtuneCount= subtune_count;	
			result.currentTrack= this.currentTrack;
			result.author= metadata.author;
			result.game= metadata.game;
			result.copyright= metadata.copyright;
			result.comment= metadata.comment;
		}
